import { Card, Col } from "react-bootstrap";

const SingleBook = ({ book }) => {
  return (
    <Col>
      <Card style={{}}>
        <Card.Img
          className="img-fluid"
          style={{
            height: 300,
            objectFit: "cover",
          }}
          variant="top"
          src={book.img}
        />
        <Card.Body>
          <Card.Title className="text-truncate">{book.title}</Card.Title>
          {/* <Button variant="primary"></Button> */}
        </Card.Body>
      </Card>
    </Col>
  );
};

export default SingleBook;
